import React from "react";
import { Bar } from "react-chartjs-2";

const data = {
  labels: ["Positive", "Negative", "Comments"],
  datasets: [
    {
      label: "# of Reviews",
      data: [13451, 11839, 10463],
      backgroundColor: [
        "rgba(255, 99, 132, 0.2)",
        "rgba(54, 162, 235, 0.2)",
        "rgba(255, 206, 86, 0.2)",
      ],
      borderColor: [
        "rgba(255, 99, 132, 1)",
        "rgba(54, 162, 235, 1)",
        "rgba(255, 206, 86, 1)",
      ],
      borderWidth: 1,
    },
  ],
};

const options = {
  scales: {
    yAxes: [
      {
        ticks: {
          beginAtZero: true,
        },
      },
    ],
  },
};

const HorizontalBarChart = () => {
  return (
    <div>
      <Bar data={data} />
    </div>
  );
};

export default HorizontalBarChart;
